function backgroundGroupMove(options) {
  var blurGroup,
    visibleGroup;

  if(!options.stroke) { options.stroke = "red";}


  blurGroup = options.blurGroup
    .append("g")
    .attr("transform",options.startTransform);

  blurGroup
    .transition()
    .ease(options.ease)
    .delay(options.delay * options.svg.frameLength)
    .duration(options.duration * options.svg.frameLength)
    .attr("transform",options.transform);

  blurGroup
    .append("path")
    .attr("d",options.path)
    .attr("stroke","red")
    .attr("stroke-width",options.strokeWidth);

  visibleGroup = options.elementGroup
    .append("g")
    .attr("transform",options.startTransform);


  visibleGroup
    .transition()
    .ease(options.ease)
    .delay(options.delay * options.svg.frameLength)
    .duration(options.duration * options.svg.frameLength)
    .attr("transform",options.transform);

  visibleGroup
    .append("path")
    .attr("d",options.path)
    .attr("stroke",options.stroke)
    .attr("stroke-width",options.strokeWidth)
    .attr("stroke-linejoin","miter");



}

function backgroundSlide(options) {
  var returns;

  returns = {};

  returns.blurGroup = options.svg.blurLayer
    .append("g");

  returns.blurGroup
    .attr("opacity",0)
    .attr("transform",options.transform)
    .attr("display","none")
    .transition()
    .delay(options.svg.frameLength * options.start)
    .duration(0)
    .attr("display","block")
    .transition()
    .duration(options.fadeIn ? options.svg.frameLength * options.fadeIn : 0)
    .attr("opacity",1)
    .transition()
    .delay(0)
    .ease(options.transformEase ? options.transformEase : d3.easeLinear)
    .duration(options.transformDuration ? options.svg.frameLength * options.transformDuration : 0)
    .attr("transform",options.endTransform ? options.endTransform : options.transform)
    .transition()
    .duration(options.fadeOut ? options.svg.frameLength * options.fadeOut : 0)
    .delay(options.svg.frameLength * options.duration)
    .attr("opacity",0)
    .transition()
    .duration(0)
    .delay(0)
    .attr("display","none");

  returns.elementGroup = options.svg.logoLayer
    .append("g");

  returns.elementGroup
    .attr("opacity",0)
    .attr("transform",options.transform)
    .attr("display","none")
    .transition()
    .delay(options.svg.frameLength * options.start)
    .duration(0)
    .attr("display","block")
    .transition()
    .duration(options.fadeIn ? options.svg.frameLength * options.fadeIn : 0)
    .attr("opacity",1)
    .transition()
    .delay(0)
    .ease(options.transformEase ? options.transformEase : d3.easeLinear)
    .duration(options.transformDuration ? options.svg.frameLength * options.transformDuration : 0)
    .attr("transform",options.endTransform ? options.endTransform : options.transform)
    .transition()
    .duration(options.fadeOut ? options.svg.frameLength * options.fadeOut : 0)
    .delay(options.svg.frameLength * options.duration)
    .attr("opacity",0)
    .transition()
    .duration(0)
    .delay(0)
    .attr("display","none");

  return returns;
}

function addSvg() {
  var exports;

  exports = {};

  exports.frameLength = 1000 / 24;

  exports.svg = d3.select("#container")
    .append("svg")
    .attr("width",960)
    .attr("height",540)
    .attr("viewbox","0 0 1280 720")
    .style("background-color","black");


  exports.frame = exports.svg
    .append("g")
    .attr("transform","scale(0.75)")
    .style("border","10px solid black");

  exports.defs = exports.svg
    .append("defs");

  exports.glow = exports.defs
    .append("filter")
    .attr("id","glow");

  exports.blurVal = exports.glow
    .append("feGaussianBlur")
    .attr("stdDeviation","45")
    .attr("result","glow");

  exports.feMerge = exports.glow
    .append("feMerge");

  exports.feMerge
    .append("feMergeNode")
    .attr("in","node");

  exports.blurLayer = exports.frame
    .append("g")
    .attr("filter","url(#glow)");

  exports.logoLayer = exports.frame
    .append("g");

  exports.crewLayer = exports.frame
    .append("g");

  exports.darken = exports.frame.append("rect")
    .attr("x",0)
    .attr("y",0)
    .attr("height",720)
    .attr("width",1280)
    .attr("fill","black")
    .attr("opacity",0.1);

  exports.playLayer = exports.frame
    .append("g");


  return exports;
}

